        <Link to="/game/medium">üü° Medium</Link>
        <Link to="/game/hard">üî¥ Hard</Link>
        <Link to="/rules">üìú Rules</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/game/:difficulty" element={<Game />} />
